import React from "react";

const TrashIcon = () => {
return (
<svg width="24" height="24" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg">
  <path d="M1.6665 7.08334H11.2498M4.99984 13.75H6.6665M8.74984 13.75H12.0832" stroke="white" stroke-width="1.5"
    stroke-miterlimit="10" stroke-linecap="round" stroke-linejoin="round" />
  <path
    d="M18.3332 10.025V13.425C18.3332 16.35 17.5915 17.0833 14.6332 17.0833H5.3665C2.40817 17.0833 1.6665 16.35 1.6665 13.425V6.57499C1.6665 3.64999 2.40817 2.91666 5.3665 2.91666H11.2498"
    stroke="white" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round" />
  <path d="M13.75 5.20832H18.3333M16.0417 7.49999V2.91666" stroke="white" stroke-width="1.5" stroke-linecap="round" />
</svg>
);
};

export default TrashIcon;
